import React from 'react';
import Calendar from 'react-calendar';

function App() {
  state = {
    date: new Date()
  }
  return (
    <div>
    <Calendar
      onChange={date => this.setState({ date })}
      value={this.state.date}
    />
  </div>
);
}

export default App;
